import React from "react";
import Data from "../../data/line_Chart_Data.json";
import {
  ResponsiveContainer,
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Legend,
  Tooltip,
  Label,
} from "recharts";
const LineChartDiagram = () => {
  return (
    <div className="mb-5">
      <ResponsiveContainer width="100%" height={600}>
        <LineChart
          data={Data}
          width={500}
          height={800}
          margin={{ top: 25, right: 2, bottom: 23 }}
        >
          <CartesianGrid strokeDasharray="5 5" />
          <XAxis dataKey="name">
            <Label value="Programming Lang" position="insideBottom" />
          </XAxis>
          <YAxis
            tickCount={9}
            label={{
              value: "student and fees data",
              angle: -90,
              position: "insideLeft",
            }}
          />
          <Tooltip contentStyle={{ backgroundColor: "yellow" }} />
          <Legend verticalAlign="bottom" height={680} />
          <Line dataKey="student" stroke="red" activeDot={{ r: 8 }} />
          <Line
            type="monotone"
            dataKey="fees"
            stroke="green"
            activeDot={{ r: 8 }}
          />
        </LineChart>
      </ResponsiveContainer>
    </div>
  );
};

export default LineChartDiagram;
